import { Box, Center, Flex, HStack, Text } from "@chakra-ui/react";
import { ColorModeSwitcher } from "./ColorModeSwitcher";

const Header = (): JSX.Element => {
    // create header with the text "My App" and a color mode switcher. The text should be centered and the switcher should be on the right side.
    return (
        <Box bg="tomato" w="100%" p={4} color="white">
            <Flex>
                <Center>
                    <Text>My App</Text>
                </Center>
                <HStack>
                    <ColorModeSwitcher />
                </HStack>
            </Flex>
        </Box>
    );


};

export default Header;
